const Navbar = () => (
  <Flex alignItems="center" justifyContent="space-between">
    <Flex flexDirection="row" justifyContent="center" alignItems>
      <Link href="/">
        <Text>Jobaho</Text>
      </Link>
    </Flex>
    <Box>
      <Link href="/">
        <Text>Home</Text>
      </Link>
      <Link href="/about">
        <Text>About</Text>
      </Link>
      <Link href="/jobSection">
        <Text>Find a Job</Text>
      </Link>
    </Box>
  </Flex>
);

export default Navbar;
